import React from 'react';

const Menu = ({ selectedComponent, setSelectedComponent }) => {
    return (
        <div className='menu-container'>
            <button
                className={`button-menu ${selectedComponent === 'users' ? 'active' : ''}`}
                onClick={() => setSelectedComponent('users')}
            >
                Пользователи
            </button>
            <button
                className={`button-menu ${selectedComponent === 'games' ? 'active' : ''}`}
                onClick={() => setSelectedComponent('games')}
            >
                Игры
            </button>
            <button
                className={`button-menu ${selectedComponent === 'settings' ? 'active' : ''}`}
                onClick={() => setSelectedComponent('settings')}
            >
                Настройки
            </button>
        </div>
    );
};

export default Menu;
